INSERT INTO `review` (`createdAt`, `updatedAt`, `id`, `reviewText`, `reviewerName`, `numberOfStars`, `reviewImage`, `reviewImageAlt`, `placeId`)
VALUES
	(1593110876558,1593110876558,2,'Crepe Boheme at the 2nd Street Public Market has become my go-to for lunch on Thursdays. I\'ve never had a crepe there that I didn\'t love! The teriyaki chicken at Isaan Baan Thai Noi is my second favorite choice for lunch. For a delicious treat, I highly recommend Sweet P\'s Handcrafted Ice Pops or the Extreme Toffee coffee from Caffeine Carl\'s.','Heather Taylor',5,'','',42),
	(1593110876560,1593110876560,12,'Right by our Dayton office and lots of variety. Only open Thursday - Saturday.','Emily Gray',4,'','',42),
	(1593110876562,1593110876562,22,'Bareburger is basically a burger, fries, and shakes kind of place, although they do offer salads and other sandwiches. They have a list of specialty burgers to choose from or you can build your own. You can get burgers made from beef, bison, black beans, duck, elk, quinoa, grilled lemon chicken, sesame ginger beef, sweet potato and wild rice, turkey, or wild boar. All except the black bean and quinoa are gluten free. For your bun, to keep it gluten free you can choose to have your burger on a tapioca bun, with no bun, served on a lettuce bed, or wrapped with a collard. Their french fries and sweet potato fries are fried separately and kept gluten free. Other gluten free items are listed clearly on the menu. Beyond their burgers and fries, I also highly recommend trying their milkshakes. My personal favorite is the Mexican Chocolate, made with chocolate ice cream, cayenne, cinnamon, and a “torched marshmallow.” Just thinking about it makes me want one.','Katy Bowman',5,'','',52),
	(1593110876561,1593110876561,32,'I found out about Bagger Dave\'s through the Gluten Free Ohio blog (glutenfreeohio.com). It has since become a favorite. I love that I can just get a burger without a bun and that the french fries and sweet potato chips are fried in separate friers and kept gluten free. My favorites are the Bacon BBQ Burger and the Saucy Sicilian Pizza Burger.','Katy Bowman',4,'','',62),
	(1593110876565,1593110876565,42,'The chicken and potatoes are sweet and spicy deliciousness! I could seriously eat here a couple times a week. The Bourbon Street Grill is a simple, down-to-earth cafe. Nothing fancy, but oh so good.','Heather Taylor',5,'','',72),
	(1593110876567,1593110876567,52,'This place is a no-frills kind of takeout. Rice, potatoes, and sweet bourbon chicken. The bags leak pretty hard, but the food is sooooo good.','Catherine Meade',4,'','',72),
	(1593110876568,1593110876568,62,'The sandwiches are as good as the owner is grumpy. It\'s a nice walk down 1st street from the Dayton Sparkbox office. I suggest the South Paw or a Breakfast sandwich, which is served all day.','Drew Clemens',5,'','',12),
	(1593110876570,1593110876570,72,'Affectionately known as \'the meat hut\' in the Sparkbox offices, I knew that my first visit to Pittsburgh would require a visit to Gaucho. Friends from Pittsburgh recommended sharing the Parrillada Mixta featuring over a pound of New York strip steak, grilled chicken breast and sweet -or- spicy chorizo paired with a side of Papas al Horno (oven roasted red potatoes with whole garlic cloves and fresh rosemary). It was fantastic! A word of warning when visiting Gaucho, be prepared to wait. Don\'t worry, it\'s worth it!','Heather Taylor',5,'','',112),
	(1593110876571,1593110876571,82,'Gaucho is an Argentinian restaurant in the Strip District that has the best tasting meats and chimichurri sauce. When you order at Guacho, you\'ll probably end up sharing your plate. They also have these little meat pockets called empanadas. My top picks would be the steak burger or any of the steak plates (sirloin, flank, ribeye). I love meat!','Anastasia Lanz',5,'','',112),
	(1593110876572,1593110876572,92,'This place gets a 3 for customer experience. The menu is written on a board on a wall (NOT ergonomic to read) and the text uses frequent, unexplained abbreviations. You generally have to wait in line, and then you have to eat quick and get out of there because lingering over a meal is frowned upon. It\'s also noisy and has bad lighting. I still haven\'t found the thing worth going back for, other than the carrots with goat cheese. Get those! You can\'t go wrong with ordering a steak. Some of the sandwiches are messy and overwhelming. The burger is probably your best bet if you go that direction. A lot of hype!','Julie Young',3,'','',112),
	(1593110876575,1593110876575,102,'I\'d highly recommend Jeet for it\'s weekday lunch buffet.','Leah Kelley',5,'','',102),
	(1593110876573,1593110876573,112,'One of my favs is Gus\' World Famous Fried Chicken. The originals are in the Memphis Area but it looks like there are some franchises sprinkled around the country. My favorite location in Memphis is a converted old southern house. Great chicken, very good sides and an extremely local atmosphere.','Masten Worley',4,'','',2),
	(1593110876640,1593110876640,122,'I prefer the lunch menu versus the dinner menu at Basil\'s. There are more gluten free options available during lunch. The open faced caprese (minus the bread) and the market toss salad are my favorites! The truffle fries are also pretty aweseme! Basil\'s has two locations, one in Dayton and the original in Troy. I have always found the service and the food better at the Troy location. The Dayton location has a great view of the river and a fantastic outdoor patio.','Heather Taylor',4,'22','Basil\'s Market Toss Salad',32),
	(1593110876648,1593110876648,132,'I LOVE Ginger and Spice. They have awesome brown sugar bubble tea, dumplings, and robust seafood options. Their lo mein is more like spaghetti, fyi. Get the Ginger & Spice chicken! Online ordering works well, too.','Catherine Meade',5,'32','Bubble Tea!',92),
	(1593110876575,1593110876575,142,'Too much mayonnaise.','Catherine Meade',1,'','',22),
	(1593110876607,1593110876607,152,'Cocos is the defacto place for the Sparkbox Holiday Party. It\'s a bit pricey, but the food is always good. I enjoy the romantic atmosphere, and you do get a large portion.','Catherine Meade',5,'2','A big steak at Cocos',82),
	(1593110876651,1593110876651,162,'I have been to Basil\'s ... 5 or so times now, and I\'ve never been wholly impressed. Their space is beautiful, I love the Peach Mojito and their fries. I had a fantastic salmon salad. Everything else? Kinda meh. A little to pricey for the quality. Also, they always give me Diet Coke when I ask for regular.','Catherine Meade',3,'12','Happy Hour apps at Basils',32),
	(1593110876678,1593110876678,172,'Finally, good Indian food in the Dayton area! The wait staff are extremely polite, and they\'ll bring you more rice for free (even just to take home).','Catherine Meade',4,'42','Jeet India',102),
	(1593110876907,1593110876907,182,'a new review','John Doe',5,'','',1);

